export function Mstitels(props) {
    return (
        <div className="card">
            <div className="card-body">
                <img src={props.imgLink} alt={this.props.name}/>
                <h4 className="card-title">{this.props.name}</h4>
                <p className="card-text">{this.props.univers}</p>
                <p className="card-text">{props.ego}</p>
                <p className="card-text">{props.job}</p>
                <p className="card-text">{props.friends}</p>
                <p className="card-text">{props.power}</p>
            </div>
            <div className="card-footer">
                <p className="card-text">{props.other}</p>
            </div>
        </div>
    );
}

export default Mstitels;
